import React from 'react';

function ImagePopup(props) {

    
    <div className="popup popup_image_scale popup_overlay popup_open">
        <div className="popup__image-content">
            <button className="popup__close-button popup__close-button_image_scale" type="button" />
            <img className="popup__image-scale" src="https://cdn.fishki.net/upload/post/2020/11/14/3473546/1580127965-14-p-amerikanskaya-kunitsa-zhivotnie-25.jpg" alt={props.name} />
            <p className="popup__image-title">{props.name}</p>
        </div>
    </div>
}

export default ImagePopup;
